import React from "react";
import github from "../../Assets/github.svg";
import linkedin from "../../Assets/linkedin.svg";
import { Container, Row, Col } from "react-bootstrap";

export default function Icons() {
    return <Row>
        <Col md={4}>
            <img src={github} />
        </Col>
        <Col md={4}>
            <img src={linkedin} />
        </Col>
    </Row>
}
